import React, { useState } from 'react'
import { Grid, Header } from 'semantic-ui-react'
import Attribute from './Attribute'

export default function Attributes() {
    const [attributeArray, setAttributeArray] = useState(['Strength', 'Dexterity', 'Constitution', 'Wisdom', 'Intelligence', 'Charisma'])

    return (
        <>
        <Header>
            Your Character's Attrubutes:
        </Header>
        <Grid columns={3} style={{marginTop:"10px"}}>
            <Grid.Row>
            {attributeArray.map((attribute, index) => {
                return <Attribute key={index} attribute={attribute} />
            })}
            </Grid.Row>
        </Grid>
        </>
    )
}
